import s from "./main-side.module.css"
import {NavLink} from "react-router-dom";
import SideFriends from "./Friends/sideBarFriends";
const Sidebar = (props) =>{
	// let sideBarElements = props.sideBar.userInfo.map( p => </>)
	return (
		<div className={s["main-screen__sidebar"]}>
			<div className={s["main-screen__sidebar-list"]}>
				<div className={s.item}>
				<NavLink to="/profile">Profile</NavLink>
				</div>
				<div className={s.item}>
				<NavLink to="/dialogs ">Messages</NavLink>
				</div>
				<div className={s.item}>
				<NavLink to="/news">News</NavLink>
				</div>
				<div className={s.item}>
				<NavLink to="/music">Music</NavLink>
				</div>
				<div className={s.item}>
				<NavLink to="/settings">Settings</NavLink>
				</div>
			</div>
			<SideFriends/>
		</div>
	);
}
export default Sidebar;
